	add("fracking", "{\"term\":\"fracking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"hydraulic Hydraulic fracturing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Andrew Chung, \u0026quot;[http://www.thestar.com/news/quebec/article/839794--quebec-between-a-rock-and-a-hard-place-on-gas-from-shale?bn\u003d1 Quebec between a rock and a hard place on gas from shale],\u0026quot; \u0027Toronto Star\u0027, 25 July (retrieved 26 July 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Still, environmentalists look to the U.S., where drilling with \u0027\u0027fracking\u0027\u0027 is now a “megatrend” and where thousands of wells dot the landscape in Pennsylvania, Ohio and Colorado. They worry about higher greenhouse gas emissions compared to conventional natural gas—because of the energy used to get the gas—and water contamination\", \"priority\":3}]}, \"synonyms\":{}}");

	add("fractal", "{\"term\":\"fractal\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027fractal\u0027 from Latin \u0027fractus\u0027 (broken) perfect passive participle of {{m|la|frangō||break, fragment}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mathematical set that has a non-integer and constant Hausdorff dimension; a geometric figure that is self-similar at all scales\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An object, system, or idea that exhibits a fractal-like property\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, John J. McGonagle, Carolyn M. Vella, \u0027The Internet Age of Competitive Intelligence\u0027, ISBN 1567202047\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In essence, you are assuming that each segment of a company is a \u0027\u0027fractal\u0027\u0027 of the whole\", \"priority\":4}]}, \"synonyms\":{}}");

