	add("fraction", "{\"term\":\"fraction\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"Malayalam\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027fraccioun\u0027 (a breaking) from Anglo-norman from Old french (842-ca. 1400) from Malayalam \u0027fractio\u0027 (a fragment, portion) from earlier Latin \u0027fractio\u0027 (a breaking, a breaking into pieces) from \u0027fractus\u0027 (English \u0027fracture\u0027 , past participle of \u0027frangere\u0027 (to break) (whence English \u0027frangible\u0027 , from Proto-indo-european {{m|ine-pro|*bʰreg-}} (English \u0027break\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A part of a whole, especially a comparatively small part\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"With fresh material, taxonomic conclusions are leavened by recognition that the material examined reflects the site it occupied; a herbarium packet gives one only a small \u0027\u0027fraction\u0027\u0027 of the data desirable for sound conclusions. Herbarium material does not, indeed, allow one to extrapolate safely: what you see is what you ge\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A ratio of two numbers, the numerator and the denominator, usually written one above the other and separated by a horizontal bar.\u0026lt;!--rational number (a rational number can always be expressed as a fraction using integers, but some fractions can even contain irrational numbers, (eg: pi/4, sqrt(2)/2; Also: ⅔/3 )--\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A component of a mixture, separated by fractionation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In a eucharistic service, the breaking of the hos\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A small amount\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d2|passage\u003dI had occasion […] to make a somewhat long business trip to Chicago, and on my return […] I found Farrar awaiting me in the railway station. He smiled his wonted \u0027\u0027fraction\u0027\u0027 by way of greeting, […], and finally leading me to his buggy, turned and drove out of town\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The act of breaking, or state of being broken, especially by violence\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Neither can the natural body of Christ be subject to any \u0027\u0027fraction\u0027\u0027 or breaking up\", \"priority\":9}]}, \"synonyms\":{}}");

