	add("framework", "{\"term\":\"framework\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|frame|work|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; The arrangement of support beams that represent a building\u0027s general shape and size\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; The larger branches of a tree that determine its shape\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; A basic conceptual structure\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dHe draws eclectically on studies of baboons, descriptive anthropological accounts of hunter-gatherer societies and, in a few cases, the fossil record. With this biological \u0027\u0027framework\u0027\u0027 in place, Corning endeavors to show that the capitalist system as currently practiced in the United States and elsewhere is manifestly unfair\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"These ‘three principles of connexion’ comprise the \u0027\u0027framework\u0027\u0027 of principles in Hume\u0027s account of the association of ideas\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; The identification and categorisation of processes or steps that constitute a complex task or mindset in order to render explicit the tacit and implicit\", \"priority\":6}]}, \"synonyms\":{}}");

