	add("france", "{\"term\":\"france\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From French \u0027france\u0027 Old french (842-ca. 1400) \u0027france\u0027 Latin \u0027francia\u0027 from {{m|la|Francī}}, the name of a Germanic tribe. Etymology of \u0027Francī\u0027 itself is uncertain, but of Proto-germanic origin, possibly related to Sanskrit \u0027firang\u0027 (foreign) \u0026lt;ref\u0026gt;A. C. Murray, \u0027From Roman to Merovingian Gaul: A Reader\u0027. Broadview Press Ltd, 2000. p. 1.\u0026lt;/ref\u0026gt; Compare \u0027frank\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A country in Western Europe which borders Belgium, Luxembourg, Germany, Switzerland, Italy, Monaco, Andorra and Spain, is a member state of the European Union and has a population of 62 million inhabitants. Official name: French Republic (République française\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Shanny Peer, \u0027France on Display: Peasants, Provincials, and Folklore\u0027 (ISBN 0791437108), page 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Although scholars have offered different chronologies and causalities for the move toward modernity, most have resolved the paradox of the two \u0027\u0027Frances\u0027\u0027 by placing them in sequence: \u0026quot;diverse \u0027\u0027France\u0027\u0027 gave way over time as modern centralized \u0027\u0027France\u0027\u0027 gathered force.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"w:Anatole Anatole France, a French poet, journalist, and novelist\", \"priority\":4}]}, \"synonyms\":{}}");

