	add("francis", "{\"term\":\"francis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027franciscus\u0027 (french(man)) (from Francia \u0027France\u0027, from the Germanic tribal name of the Franks, meaning frank, free), originally a nickname of St. Francis of Assisi.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1591\u0027\u0027 William Shakespeare: \u0027Romeo and Juliet\u0027: Act V, Scene III\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Saint \u0027\u0027Francis\u0027\u0027 be my speed! how oft tonight / Have my old feet stumbled at graves\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1820\u0027\u0027 w:Leigh Leigh Hunt, \u0027Names\u0027, The Indicator, No. XVIII, February 9th, 1820\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Francis\u0027\u0027 is one of the pleasantest names in use. It has a fine open air with it, - a sound correspondent to its sense\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 , \u0027One Good Turn\u0027, Black Swan(2007), ISBN 9780552772440, page 454\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Francis\u0027\u0027 had never been \u0027Frank\u0027 or \u0027Fran\u0027, he had always been called by his full name. It had lent him a certain dignity that he had possibly never earned\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a rare spelling variant of Frances\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A ghost town in Nebraska\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A town in Saskatchewan, Canada\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A town in Utah\", \"priority\":10}]}, \"synonyms\":{}}");

